import React from 'react';
import { Route, Switch } from 'react-router-dom';
import Home from './Home';
import NoSSR from './NoSSR'
import './App.css';

const App = () => (
    <Switch>
        <Route exact={true} path="/" render={() => <NoSSR><Home /></NoSSR>} />
    </Switch>
);

export default App;
